built-in.html.body:
Built-in types
Types in programming languages can accurately be described as sets of values. We'll be taking a look at the fundamental types built-in to TypeScript to tell us what we can use in our type annotations.

Boolean
A basic type, it represents the set of values true and false. 
let logicalResult: boolean = true;
logicalResult = false;
logicalResult = 5 > 3;

Number
TypeScript does not differentiate between different floats, doubles, integers etc. More accurately, all numbers are floating point values.
let numberResult = 5 + 3 - 1;
numberResult = 0.444444444 * -1;

String
The string type represents text. There is no smaller type such as the character type. Thus, it can be zero or more characters surrounded by single quotes 'test' or double quotes "test".
let aString = "goodbye.";
aString = 'so soon';

Any
The any type can be used to opt out of type checking. "Any" matches with all types. It can also be used to describe values that we might not know the type of at the time of writing. Or potentially "catch" all functions. As the official TypeScript documentation notes on the any type, it can be used while porting existing to JavaScript code to TypeScript, and then later one may go back and fill in the types gradually. 
let anything: any = "this";
anything = 'can';
anything = 4;
anything = false;
anything = ["be", "anything"];

Array
The array type represents a collection of values of homogeneous types. The following are equivalent ways to declare an array type.
const numberArray: number[] = [1, 2, 3];

const numberArray: Array = [1, 2, 3];

const multiTypeArray: (number | string)[] = [1, 2, "3"];
const anyTypeArray: any[] = [1, 2, "uh", "typescript", true];

Tuple
The tuple type is similar to array, but have a fixed length. They can also be heterogeneous. Useful for when you will know confidently what the length will be of the collection every time. 
We'll see elements of place-oriented programming here as order does matter.
let tupleValue: [number, string, string];
tupleValue = ["brook", "crook", -43]; // TypeScript will error out here!
tupleValue = [-41, "cook", "book"];

Enum
Enums give you a collection of labelled resuable values. 
enum Directions {Up, Down, Left, Right}
let currentDirection = Directions.Up;

if (currentDirection === Directions.Up) {
    console.log("It's up!");
} else if (currentDirection === Directions.Left) {
    console.log("Same as my non-dominant hand.");
} else if (currentDirection === Directions.Right) {
    console.log("No comment.");
} else {
    console.log("We don't believe in this direction.");
}

Void
void is normally used to describe the return values of functions that do not return anything. It can be used to describe variable types. This describes the set of only null or undefined.
function doSomething(): void {
    console.log("I did it.")
}

doSomething();

const x: void = undefined;

Null and Undefined
null and undefined are both the only members of their respective sets. However, they are subtypes of all other built-in types unless users remember to turn on strictNullCheck (as recommended by the TypeScript Handbook). With this flag on null and undefined are no longer subtypes of other types.
This is recommended because it address the million dollar mistake! Normally, null and undefined as part of other types allows these values to propagate through as developers commonly forget to account for these values coming up in their program. These commonly result in null-reference exceptions. But, turning the flag on will force developers to account for the possibility of null and undefined. We cannot really use null and undefined on their own, but with the strictNullCheck on we can union these types with other built-ins to force us to remember to handle nullable types.
// Assuming we have `strictNullCheck` on:
function compute(n: number | null): number{
    return n + 5; // Won't compile! TypeScript knows this could be possibly `null`!
}

// Assuming we have `strictNullCheck` on:
function computeButZeroIfNull(n: number | null): number{
    if (n === null) { 
        return 0;
    }
    // An example of control-flow based analysis! TypeScript can reason here
    // that we checked if it was null earlier, so here `n` MUST be number at 
    // this point.
    return n + 5; 
}

Never
A never value can never be assigned to ANY other type, even any. It is meant to describe values which in code that will be reached.
function throwAnError(): never {
    throw new Error("This function will never return a value.");
}

Object
object is a type meant for making built-in library functions make better sense in this type system. Additionally, they represent the set of values of non-primitives such as NOT number, boolean, string etc.

project-setup.html.body:
Project setup
TypeScript projects normally are structured as conventional NodeJS projects. The package.json and tsconfig.json files should be in the root directory. 
Reminder: TypeScript must be installed via NPM! npm install typescript. You can also quickly generate a tsconfig.json file with default options by entering tsc --init in your favorite terminal at the desired folder of a TypeScript project.
Assume our tsconfig.json file has the following contents:
{   
    "compileOnSave": true,

    "compilerOptions": {
        "outDir": "./built",
        "allowJs": false,
        "target": "es2016",
        "noImplicitAny": true,
        "strict": true,
        "noImplicitThis": true,
        "rootDir": "src" 
    },
}

The following represents the structure of what our root directory would be:
src   If one does not specify an outputDir in the tsconfig.json file then TypeScript defaults to outputting files into the built folder at the root of the project. Note that TypeScript preservers the file structure of the src folder. 
Let's say there are test scripts we DON'T want TypeScript to try to compile for some reason.
{   
    "compileOnSave": true,

    "compilerOptions": {
        "outDir": "./built",
        "allowJs": false,
        "target": "es2016",
        "noImplicitAny": true,
        "strict": true,
        "noImplicitThis": true,
        "rootDir": "src" 
    },

    "exclude": [
        "src/test/**/*"
    ]
}

Thus, after you run tsc your file structure would look like:
src   Working with node modules in TypeScript
It would be a shame to took advantage of the NodeJS module ecosystem we have access to. Many npm modules have been updated by their creators to include types for us to work with, and some have not been updated. But that's ok if they have not! Npm modules that have not been updated to include type annotations are still compatible. 
First, we will look at trying to use a built-in module from NodeJS to read and write to a simple file. 

We'll have to install the types documentation for the NodeJS modules. Run, npm install @types/node --save-dev at the root of your project via your favorite terminal.

Make sure in the "compilerOptions" in your tsconfig.json field contains the following value and field:
{
 "compilerOptions": {
     ...
     "moduleResolution": "node"
     ...
 }



// src/readFile.ts
import * as fs from 'fs';
console.log(fs.readFileSync('./readme.md'));

Running files
TypeScript does its checks during compile time. So, we can compile it by running tsc in your favorite terminal. If the output directory does not already exist TypeScript will make one for you, and copy your folder structure as well. 
CD into the built folder and look for the name of your TypeScript file, but with a .js extension. Run a node command using that file as the parameter. node built/src/readFile.ts. 
It works similar for non-built-ins! Be sure to npm install  and TypeScript will suggest to you if there is extra type documentation recommended for downloaded for that specific module. If the types exist, the module and any code you have that uses will be checked by TypeScript to be type safe! Additionally, it even enables editors that work well with TypeScript to provide an autocomplete that would not have existed prior. 
Creating your own modules
Just as common, users create their own modules for convenient reuse. Here is how you can write and import different TypeScript programs as modules:
// Assume this file is named something like, `src/shape.ts`
// Export allows us to use this class in other files.
export class Shape {
    // something to note here is that the keyword public 
    // will automatically make a `this.number = number;` for you. 
    public Shape(public numberOfSides: number, rounded: boolean) {
        this.rounded = rounded;
    }
}

// Assume this file is named something like, `src/shapeUser.ts
// AND that `src/shape.ts` exists.
// We destructure the shape property from the export, then
// we make an alias for us so we can label it as `shapeClass`
export {Shape as shapeClass} from "src/shape.ts";
const circle = new Shape(5, rounded = false);
}

There's a lot more to it, but this should be good starting point for users to get a sense of how TypeScript projects can be setup.

more-types.html.body:
How to do more interesting things with types
We've seen some trivial examples of TypeScript's type system. It is time to expand on that! We will be exploring more interesting features in the type system and how these can be used practically in programs.
Type alias
If we want to reuse type declarations, we can declare them using type nameOfType = number | string. Now, the type nameOfType represents the union type of number and string. Type aliases don't declare new types, they are simply names that represent the type they represent.
Interface type
To describe the type of objects in TypeScript, we use interface types. TypeScript follows the principle of structural types, sometimes known as duck typing. Types are not compatible just because we say they are. Types are compatible if they are. For example:
interface Vehicle {
    grounded?: boolean;
    numberOfWheels: number;
    model: string;
}

// TypeScript will check to make the object literal we are assinging
// has the *exact* same properties and nothing else!
const car: Vehicle = {
    numberOfWheels: 4,
    grounded: true,
    model: "best model"
};

// TypeScript will point out an error here because the variable `bike`
// does *not* have model. 
const bike: Vehicle = {
    numberOfWheels: 2,
    grounded: true
};

// TypeScript will point out an error here because the variable `boat`
// has an extra property and thus is not the same structural as the
// vehicle type. 
const boat: Vehicle = {
    numberOfWheels: 0,
    model: "best boat",
    grounded: true,
    harbor: "west"
};


Interface types can use the keyword `extends` on  other interfaces. This copies the properties to allow you to reuse types.

```TypeScript

interface Vehicle {
    wheels: number;
    model: string;
}

interface Airplane extends Vehicle {
    airline: string;
}

const plane: Airplane = {
    wheels: 5,
    model: "fast",
    airline: "cheap"
}

Union type
Union types describe the set for values that are compatible to all types that are in the union. The | is used to describe the members of the union. For example, number | boolean | string describes the union type that is compatible with values that are compatible with either number, boolean, or string.
If there are functions that we expect to take a string or number we might use the union type to describe this. Union types also work with interface types. They only allow you to use members that are in all types of the union.
interface Square {
    color: string,
    width: number
}

interface Circle {
    radius: number,
    color: string
}

const a: Square | Circle = {
    radius: 4,
    color: "red"
};

let colorResult = a.color; // At this point, `a` is compatible with the `Circle` type specifically so
let radius = a.radius;     // we are able to access properties of the `Circle` interface.

function generateAShape (): Square | Circle {
    return { color: "green", width: 5 };
}

const g = generateAShape();
g.color; // We can access the color property because it is common to both Square AND Circle.
g.width; // We cannot access the width property because we cannot guarentee this property will exist.

Intersection type
Intersection types describe a set that is compatible with objects that are a combination of all the types that are being intersected. This can be used when you need an object that has the properties of ALL types in the intersection. 
interface Square {
    color: string,
    width: number
}

interface Circle {
    radius: number,
    color: string
}

type intersectionType = Square & Circle;

function generateAShape (): intersectionType {
    return { color: "blue", width: 10, radius: 5 };
}

const result = generateAShape();
console.log(result.color, result.width, result.radius);

Generics
Sometimes we do not know what the exact type will be, but we do know what we need to do with it! In that case we can use generics. When we're declaring a generic type, we use type parameters that we take in.
// Not too useful, we're simply 
// giving the type back to them.
type genericExample = T; 
const genericValue: genericExample = 5; 

interface GenericInterface {
    genericValue: T
}

const genericInterfaceExample: GenericInterface = {
    genericValue: "example of a generic thing"
};

Inspired by an example from the TypeScript handbook. This is an example of types being recursive as you can see it refers to itself. 
// Perhaps a more useful example.
// We can use generics to represent
// a tree data structure.
interface LinkedTree {
    leftSubTree: LinkedTree,
    rightSubTree: LinkedTree
    innerValue: T,
}

Fun fact, you might think that this type is infinitely recursive. As to figure out what a leftSubTree: LinkedTree is, the compiler would refer back to the definition and see again that it is an interface that contains a leftSubTree of type LinkedTree and so on and so on.
Turns out, the designers behind TypeScript solved the problem by following their principle that they don't need 100% soundness. They decide to cut off checking at 5 levels of recursion and just trust the type at that point. (They showcased this in their TypeScript 2018 Build video which can be found here).
Conditional type
One of the more esoteric but powerful type features in TypeScript. Conditional types specify the type based on a condition. The quickest way to see this is with examples:
// This line essentially says grab the type of the elements of
// the array. `T extends Array` means the type parameter must 
// be compatible with the `array` type. `` means 
// the type parameter `U` will be inferred from the member type
// of the array. 
type Flatten = T extends Array  ? U : T;
const a: Flatten = 5; // number type

// We can also exclude types, and say "we accept certain things BUT NOT this type".
type Exclude = T extends U ? never : T;
type T1 = Exclude void), Function>; // number | string

Optional type
In the cases where you want a parameter to be optionally passed in, we can denote these using a ?.
interface Square {
    width: number;
    color: string;
}

function generateSquare(width: number, color?: string) {
    return {
        width: width,
        color: color ? "white" : color
    };
}         

// By default if a parameter doesn't get passed in but
// it is flagged as an optional parameter it is given
// a value of undefined.
const callResult = generateSquare(100);
const greenSquare = generateSquare(20, "green");

Index type
There are cases where you might want to type something based on the properties of an interface type. These might look a bit harder to understand but I'll do my best to comment what's happening. The keyof operator can be used to refer to something as the union of the properties of the type. See below! 
interface Vehicle {
    wheels: number;
    grounded: boolean;
    name: string;
}

let b: keyof Vehicle;
b = "wheels";
b = "grounded";
b = "name";
b = "model"; // Errors out here! It *must* be a property of the `Vehicle` interface.

The keyof keyword creates a union between the names of the properties of the Vehicle interface type. If you add properties later on to the Vehicle type, the type of b will automatically be updated to have the new properties at compile time.
You can also type the members of a mapping. [key: string]: number, describes a mapping that takes in keys only of the string type that map to values only of the number type. 
// A reminder you can name the type parameter anything you want, common convention is to name T for type. But for 
// demonstration purposes we'll name it M here.
interface NumberedMapping {
    [key: string]: number;
}

interface NumberedMapping {
    [key: number]: M;
}

const a: NumberedMapping = {
    1: false,
    2: true,
    3: true
};

const b: NumberedMapping = {
    10: true,
    13: false,
    99: "false" // TypeScript will point out this isn't a boolean!
};

Classes
Classes are meant for more classic object-oriented needs. They function how one might suspect. They seem relatively similar to interfaces in TypeScript. But interfaces do not provide implementation, they are merely descriptions of what needs to be in. Classes typically provide enough information for objects to be instantiated from and thus include implementations.
Classes can extend one another, copying and reusing properties of another.
TypeScript also includes modifiers such as public, private, and protected. Properties of a class are public unless stated otherwise and are accessible by anything. private is only accessible within a class, protected can be accessed by any of the classes that derive the current class.
class Square {
    width: number;
    public color: string;
    private defaultFillColor: "yellow";
    protected defaultOutlineColor: "green";

    constructor(width: number, color?: string) {
        this.width = width;
        this.color = color ? color : this.defaultFillColor;
    }

    computeArea(): number {
        return this.width * this.width;
    }
}

class GreenOutlineSquare extends Square {
    constructor (width: number) {
        super(width);
        this.defaultOutlineColor = "green";
    }
}

const basicSquare = new Square(40, "red");
console.log(basicSquare.color);
console.log(basicSquare.defaultFillColor); // Errors out because it is private!
let area = basicSquare.computeArea();

const permanentGreenOutlineSquare = new GreenOutlineSquare(10);
area = permanentGreenOutlineSquare.computeArea();

There's also a lot more
I'll leave this here one more time. We've probably only scratched the surface here! The official TypeScript Handbook has a lot more to say about types.

