type CurriedFunction = (s: string) => (CurriedFunction | string); 

function say(input: string): (CurriedFunction | string) {
    let words = '';

    const chain = (str: string): (CurriedFunction | string) => {
        if (str) {
            words += str + " ";
        }

        return str ? chain : words.trim();
    };

    return chain(input);
}

